  false,\n\t\"url\": null,\n\t\"notes\": \"PLEASE SEE ARIZONA AQUEOUS CHEMISTRY FOR
  COMBINED WELL AND SPRING DATASETS. This dataset is a compilation of Aqueous Spring
  Chemistry observations compiled by the Arizona Geological Survey, published as a
  Web feature service, a Web map service, and ESRI service and an Excel spreadsheet
  for the National Geothermal Data System. The spreadsheet contains 15 worksheets,
  including information about the template, notes related to revisions of the template,
  Resource provider information, the data, a field list (data mapping view), An Analyte
  Dictionary and a worksheet with vocabularies for use in populating the spreadsheet
  (data valid terms). Data from 116 springs are included.\",\n\t\"license_title\":
